// App.jsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SchoolList from './components/SchoolList';
import SchoolDetails from './components/SchoolDetails'; // Create SchoolDetails component

function App() {
    return (
        <Router>
            <div className="App">
                <header className="App-header">
                    <h1>Teacher Management</h1>
                </header>
                <main>
                    <Routes>
                        <Route path="/" element={<SchoolList />} />
                        <Route path="/school/:schoolId" element={<SchoolDetails />} /> {/* Route for SchoolDetails */}
                    </Routes>
                </main>
            </div>
        </Router>
    );
}

export default App;
